import '../styles/contact.scss';

export class Contact extends Component {
    render() {
        return (
            <div className="contact-container">
            <div className="textarea">

                <h2>Contact</h2>

                <p>
                <a href="https://www.facebook.com/gabrielle.kamph" target="_blank"><i class="fab fa-facebook"></i></a> 
                <a href="https://www.linkedin.com/in/gabriellekamph/" target="_blank"><i class="fab fa-linkedin-in"></i></a> 
                <a href="https://github.com/gabriellekamph" target="_blank"><i class="fab fa-github"></i></a> 
                <a href="mailto:hello@gabriellekamph.se"><i class="fas fa-at"></i></a> 
                <a href="tel:+46761822864" target="_blank"><i class="fas fa-mobile-alt"></i></a> 
                </p>

                </div>
                            </div>
        )
    }
}

export default Contact
